        protected virtual string[] ParseProductTags(string productTags)
        {
            var result = new List<string>();
            if (!string.IsNullOrWhiteSpace(productTags))
            {
                var values = productTags.Split(new[] { ',' }, StringSplitOptions.RemoveEmptyEntries);
                foreach (var val1 in values)
                    if (!string.IsNullOrEmpty(val1.Trim()))
                        result.Add(val1.Trim());
            }
            return result.ToArray();
        }

        protected Picture SavePictureAndAssignToProduct(byte[] fileBinary, Product product)
        {
            Picture picture = _pictureService.InsertPicture(fileBinary, MimeTypes.ImagePng, null);
            _pictureService.UpdatePicture(picture.Id,
                _pictureService.LoadPictureBinary(picture),
                picture.MimeType,
                picture.SeoFilename,
                product.Name,
                product.Name,
                false,
                false,
                null,
                null,
                null,
                null);

            _productService.InsertProductPicture(new ProductPicture
            {
                PictureId = picture.Id,
                ProductId = product.Id,
                DisplayOrder = 0,
            });

            return picture;
        }

        protected string GenerateNewDiscountCode(int charactersCount = 5)
        {
            string newCode;
            do
            {
                newCode = GenerateRandomCode(charactersCount);
            } while (_discountService.GetAllDiscounts(couponCode: newCode).Count > 0);
            return newCode;
        }

        private string GenerateRandomCode(int length)
        {
            const string chars = "ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789";
            return new string(Enumerable.Repeat(chars, length).Select(s => s[random.Next(s.Length)]).ToArray());
        }

        protected virtual void AddOrderNote(Order order, string note)
        {
            order.OrderNotes.Add(new OrderNote
            {
                Note = note,
                DisplayToCustomer = false,
                CreatedOnUtc = DateTime.UtcNow
            });

            _orderService.UpdateOrder(order);
        }
